import CSSProps from "../data/constants/CSSProps";
export class Base {
    SwitchPage(){
        alert("Base called");
        const home = document.getElementById(CSSProps.ID.Home);
        
        if(home){
            home.style.cssText="color: red;";
        }
    }
}
